Having regard to the Treaty establishing the European Community,
Having regard to Council Regulation (EEC) No 234/79 of 5 February 1979 on the procedure for adjusting the Common Customs Tariff and Nomenclature used for agricultural products (1), as amended by Regulation (EEC) No 3209/89 (2), and in particular Article  2 (1),
Having regard to Council Regulation (EEC) No 804/68 of 27 June 1968 on the common organization of the market in milk and milk products (3), as last amended by Regulation (EC) No 2807/94 (4), and in paricular Article 14 (6) thereof,
Whereas Commission Regulation (EC) No 3115/94 of 20 December 1994 amending Annex I and II to Council Regulation (EEC) No 2658/87 on the tariff and statistical nomenclature and on the Common Customs Tariff (5), provides for amendments from 1 January 1995  in the case of certain cheeses falling within CN code 0406;
Whereas Article 14 of Regulation (EEC) No 804/68 provides for the application of an import levy on the products governed by that Regulation;
Whereas, pursuant to Article 14 (6) of Regulation (EEC) No 804/68, Council Regulation (EEC) No 2915/76 (6), as last amended by Regulation (EC) No 3423/93 (7), determines the group of products and the special provisions for calculating levies on milk and  milk products; whereas that Regulation needs to be amended as a result;
Whereas the measures provided for in this Regulation are in accordance with the opinion of the Management Committee for Milk and Milk Products,
